package com.example.Quora.services;import com.example.Quora.models.User;import com.example.Quora.repository.UserRepository;public class UserService {    private final UserRepository userRepository;    public UserService(UserRepository userRepository) {        this.userRepository = userRepository;    }    public User Register(User userData){        try{            return userRepository.save(userData);        }        catch(Exception e){            System.out.println(e.getMessage());            return  null;        }    }}